import { MDBContainer, MDBFooter } from "mdb-react-ui-kit";

const CustomFooter = () => {
  return (
    <MDBFooter
      className="text-center darkBackground text-white fixed-bottom"
      dark
    >
      <MDBContainer className="text-center p-1">
        Este produto usa a API do TMDB, mas não é endossado ou certificado pelo
        TMDB
      </MDBContainer>
    </MDBFooter>
  );
};

export default CustomFooter;
